(2, 'ભારતથી ક્યારે છુટકારો મળશે?', '<p>ભારતમાં એક વર્ગ એવો છે જેને પરિસ્થિતિ બદલવામાં કોઈ રસ નથી. તેઓ માને છે કે &lsquo;પરિસ્થિતિ બદલ્યા કરતા પોતાને સમય આપીશું તો જલ્દી આગળ વધીશું.&rsquo; અને આ વાત પણ અમુક અંશે સાચી છે, માટે ભારતનું યુવા ધન વિદેશ જઈ રહ્યું છે અને અનેક લાખો યુવાનો રાહ જોઇને બેઠા છે કે ભારતથી ક્યારે છુટકારો મળશે?એક ઉચ્ચ શિક્ષિત યુવાન સાથે વાતચીતમાં જાણવા મળે છે કે : ભારતમાં કોઈ પ્રકારે સંશોધનને વેગ નથી મળતો, આપણે એવી વસ્તુ અને ટેકનોલોજી વાપરી રહ્યા છે જે 5 &ndash; 10 વર્ષ પહેલા વિદેશીઓએ શોધી અને વાપરી ચુક્યા છે, જેનો અર્થ એમ નથી કે ભારતના યુવાનો પાસે સ્કીલની ખોટ છે. જેમ ભારતમાં સરકાર દ્વારા જે skill development ના ક્લાસ ચલાવવામાં આવે છે, તેની વાસ્તવિકતા ખુબ કડવી છે, જે માટે આપણી શિક્ષણ વ્યવસ્થા પણ ખુબ મોટો ભાગ ભજવી જાય છે. સામાન્ય અર્થમાં સમજીએ તો આપણે એવી વ્યવસ્થા સાથે જોડાયેલા છે, જે આપણાને પધરાવવામાં આવી છે અને તેના કારણે જ ભારતના કોઈ યુવાન ઇનોવેશન કે આઈડિયા વિશે વાત નથી કરતા. જેનાથી વિપરીત વિદેશી શિક્ષણ પ્રણાલી ચોપડિયા જ્ઞાન કરતા બાળકોની ચિત્ત-બુદ્ધિને પારખી સ્કીલ વધારવા પર ખુબ ધ્યાન આપે છે. જ્યાં સરકાર પણ તેના માટે આર્થિક અને અન્ય બીજી રીતે મદદ કરે છે, માટે જ અમેરિકા જેવા દેશ પાસે આજથી ૩૦ વર્ષ સુધી દુનિયાને ચલાવવાની સંશોધકીય વ્યવસ્થા ડેવેલોપ થઇ ચુકી છે જેમાં ભારતના પણ અનેક યુવાનો તેમાં સહભાગી બન્યા છે. માટે ભારતમાં ઉચ્ચ શિક્ષણ મેળવી ચુકેલા યુવાનો અન્ય દેશમાં જવાનું વધુ પસંદ કરે છે, જ્યાં પોતાનામાં રહેલી expandability &ndash; ability બતાવવા ખુબ મોટું માળખું મળી રહે છે.</p>\r\n', '1625125643.png', '2021-07-01 13:17:23', 'ભરતથ-કયર-છ???કર-મળશ', 1),
