(4, 'NO DUSTBIN SAY RECYCLE BIN', '<p><span style=\"color:#e67e22\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">&nbsp; &nbsp;મોટા મોટા દેશ માટે નાના દેશ જાણે dastbin બની ગયા છે</span>, <span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">જે દેશ વિકસિત છે તે દેશ દ્વારા પ્રોસેસ પ્લાન્ટની પ્રક્રિયા બાદ ખરાબ કચરો એશિયા, આફ્રિકા અને તેના જળવિસ્તારમાં ઠાલવવામાં આવે છે. એક ન્યુઝ રીપોર્ટ પ્રમાણે વિકસિત દેશોના અનેક કન્ટેનર ઇન્ડોનેશિયા જેવા દેશમાં મોકલી દેવામાં આવ્યા હતા. જેમાં ભારત પણ એક દેશ છે જેની જળસીમાં અનેક વિકસિત દેશ દ્વારા પ્રદુષિત કરવામાં આવે છે.</span></span></span></span></p>\r\n\r\n<p><span style=\"color:#e67e22\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">&nbsp; &nbsp;જયારે મોટા દેશની નૈતિકતા એવી હોવી જોઈએ કે તેઓ જળવાયું પ્રદુષણ પર પોતે પહેલા નિયંત્રણ કરે અને સમગ્ર દુનિયાને બાયો &ndash; ઇકો dayvarsiti થી જાગૃત કરે. પણ તેનાથી ઉલટું જયારે તેઓ દુનિયાને ગ્લોબલ વોર્મિંગ થી જાગૃત થવા માટે નિયંત્રણ લાવવાનું કહે છે પણ પોતે બધાજ નિયમોનો ભંગ કરે છે, જેના પરિણામે ૨૦૨૧ જુન મહિનામાં આજ સુધીમાં પહેલી વાર કેનેડા અને અમેરિકી વિસ્તારની આજુબાજુ તાપમાન ૪૫-૫૦ ડીગ્રી સુધી પંહોચી ગયું. </span></span></span></span></p>\r\n\r\n<p><span style=\"color:#e67e22\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">&nbsp; &nbsp;જે પ્રમાણે માનવ સભ્યતા દરેક પ્રકારે કુદરત સામે પડકાર ઉભો કરી રહી છે તે સાચા અર્થમાં પોતાના પરજ કુહાડીના ઘા સમાન છે. જ્યાં સુધી દુનિયાના દરેક નાના-મોટા દેશમાં વસ્તુ વપરાશનુ યોગ્ય શિક્ષણ નહીં આવે તો સુધી પ્રદુષિત પાણી, હવા અને ખોરાક જ આપણું ભવિષ્ય છે.&nbsp;&nbsp; </span></span></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#e67e22\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><strong>NO DUSTBIN SAY RECYCLE BIN</strong></span></span></span></p>\r\n\r\n<p><span style=\"color:#e67e22\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '1625830385.png', '2021-07-09 17:03:05', 'no-dustbin-say-recycle-bin', 1),
(5, 'KAPPALI', '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">પ્લાસ્ટિક કોઈ સમસ્યા નથી પણ ખુબ સારું સંશોધન છે, જે માનવ સભ્યતાની જરૂરિયાત અને સુખ સુવિધાને ઘણી આશાન કરે છે. પ્લાસ્ટિક જેને આપણે માત્ર પોલીથીનથી જોઈએ છે તે પ્લાસ્ટિકના ઘણા રૂપ રંગ છે. આશરે દુનિયાના અલગ અલગ દેશો 80 થી વધુ પ્રકારના પ્લાસ્ટિકનો ઉપયોગ કરે છે. જ્યારે આપણે પ્લાસ્ટિકને બદનામ થયેલી વ્યવસ્થાના રૂપે જોઈએ છીએ. </span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">પણ, તે વજનમાં હલકું છે, તે ખુબ ટકાઉ અને મજબુત છે, જે અન્ય ધાતુ કરતા ખુબ સસ્તું છે. જયારે તેના ઉપયોગની ગેરસમજ પર્યાવરણને ખુબ નુકશાન પહોચાડે છે. &nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">ભારતમાં પ્લાસ્ટિક કચરાથી ઓઈલ અને ગેસ પણ બનાવવાના પ્લાન્ટ સક્રિય છે, પણ સાથે તેવું પણ જાણવા મળે છે કે પ્લાસ્ટીકને ઓઈલ સુધી પહોચતા જે પ્રોસેસનો સામનો કરવો પડે છે, તે પ્રોસેસ બાદ ઘણા ઝેરી તત્વો વાતાવરણમાં ભળે છે.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">ભારતમાં રીસાયકલ દેશોમાં ખુબ દયજનક પરિસ્થિતિમાં છે, અહીં રીસાયકલ કરવા માટેની કોઈ યોગ્ય કક્ષાની મશીનરી જોવા નથી મળતી, પરિણામે બધુજ પ્લાસ્ટિક રીસાયકલ રૂપે વાપરવામાં આવે છે જે હવા-પાણીમાં ભળે છે. ભારતમાં ઉપયોગ કરાતો પ્લાસ્ટિક જથ્થો ખુબજ નિમ્ન કક્ષાનો હોવાથી સ્વાસ્થ્ય માટે પડકાર ઉભા કરે છે</span>. <span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">જ્યાં વિશ્વના મોટા મોટા દેશો જે પ્લાસ્ટિક કચરો ફેવાલે છે</span>,<span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\"> તેમાં ભારત સૌથી ઉપરના સ્થાને આવે છે.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Shruti&quot;,&quot;sans-serif&quot;\">જેના મુખ્ય કારણ અથવા ઉપાય તરીકે શિક્ષણને જોઈ શકાય. જો ભારતમાં પ્લાસ્ટીકના યોગ્ય ઉપયોગનું શિક્ષણ વધશે તો સારા પ્લાસ્ટીકનો ઉપયોગ શક્ય બનશે, જે માનવ સભ્યતા માટે સુવિધા અને સ્વસ્થ જાળવણી કરશે. માટે પ્લાસ્ટીકનો ઉપયોગ બંધ કરવો તેના કરતા તેનો ઉપયોગ કેમ કરવો? તેની સમજ જો આવે તો પર્યાવરણની રક્ષા પ્લાસ્ટીકની ખરીદી વખતેજ શક્ય બનાવી શકાય.</span></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><strong><u>NO DUSTBIN SAY RECYCLE BIN</u></strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></p>\r\n', '1625830442.jpg', '2021-07-09 17:04:02', 'kappali', 1),
(6, 'MY COUNTRY IS NOT \'DUSTBIN\'', '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">For a large country, small countries have become dustbin, the country that is developed, dumps bad waste in Asia, Africa and its waters after the process of processing plants. According to a news report, several containers from developed countries were sent to countries like Indonesia. India is also a country polluted by several developed countries in its waters.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">While the morality of a big country should be such that they control climate pollution first and make the whole world aware of bio-eco diversity. But on the contrary, when they ask the world to control global warming, they violate all rules, which resulted in temperatures reaching 45-50 degrees around Canada and the Us region for the first time in June 2021.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Just as human civilization is challenging nature in every way, it is truly like an axe wound on its own. Unless there is proper education in the use of goods in every small and big country of the world, polluted water, air and food are our future only.</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">NO DUSTBIN SAY RECYCLE BIN</span></span></p>\r\n\r\n<p style=\"text-align:right\">PUBLISHED BY &#39;KAPPALI</p>\r\n', '1626017697.jpg', '2021-07-11 21:04:57', 'my-country-is-not-dustbin', 0),
(7, 'PLASTICS IS GREAT INNOVATION', '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Plastic is not a problem but very good research which greatly hopes for the need and comfort of human civilization. Plastic which we see only as polythene has lot of forms &amp; colours. Different countries of the world use approximately more than 80 types of plastics. when we see plastic as a discredited system.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; But, it is light in weight, it is very durable and strong, which is very cheaper than other metals. While misunderstanding of its use causes a lot of damage to the environment.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Plastic waste to oil and gas manufacturing plants are also active in India, but it is also learnt that many toxic elements mix with the atmosphere after the process that plastic has to deal with when it reaches oil.&nbsp; </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; India is in a very pathetic situation in recycle countries, there is no proper level of recycling machinery, as a result all plastic is used as a recycle which mixes with air and water. The plastic quantity used in India is of very low quality and pose a health challenge. India ranks at the top of the plastic waste dumps by the world&#39;s largest countries.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Education can be seen as the main reason or solution for which. If proper use of plastic education increases in India, it will be possible to use good plastic, which will facilitate and maintain healthy for human civilization. So how to use plastic rather than stop using it? If it is understood, it can be made possible only when purchasing plastic to protect the environment.</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">NO DUSTBIN SAY RECYCLE BIN</span></span></p>\r\n\r\n<p style=\"text-align:right\">PUBLISHED BY &#39;KAPPALI</p>\r\n', '1626018169.jpg', '2021-07-11 21:12:49', 'plastics-is-great-innovation', 0),
(8, 'POLLUTION BY MILITARY', '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;Which army of the world spreads pollution at maximum?</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;The United States ranks first, followed by China, Russia, India, Pakistan, Britain, and North Korea, such as many military attacks, defences, security, training, pollutes through a variety of drills.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;In the name of many warships, ammunition, mock drills, military drills, show of strength, many countries release carbon into the air in many ways to dominate.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;The American superpower, which dominates the whole world, is at the top. Whose armies are found on Iran, Iraq, Afghanistan, Pakistan, Japan, India, Australia, South Korea, China Sea. Thus, the United States has its own military empire over more than half of the world.&nbsp; </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;When it comes to pollution, the factory is generally noticed, but the pollution by the army is ignored by all the countries from the point of view of security. While we are securing borders on the one hand, on the other hand, we are turning the whole world into a cyclone in pollution that cannot be killed by any weapons or army or any superpower to an enemy called pollution. Nature is waiting for a law that reduces or stops the use of military weapons by understanding its morality. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">PUBLISHED BY &#39;KAPPALI&#39;</span></span></p>\r\n', '1626018583.jpg', '2021-07-11 21:19:43', 'pollution-by-military', 0),
(9, 'FISHLESS OCEAN', '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;There is a forest under the sea which we have hunted tigers and lions a lot but how much do we need this marine life?</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;There is nothing in the nature which does not connect or affect us.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;Humans are calling themselves great by hunting sharks and whales. Just as man&#39;s eyes on tiger leather and nails deteriorated, we also saw a lot in the vomit of the whales inside the sea. And because of this, many species of whales disappeared.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;But if we understand the marine world, just as there are lions and tigers in the forest, there are whales and sharks in the sea, through whose feces many marine plants get nourishment. Which becomes food for small creatures, when small creatures eat small fish, those fish become prey of big fish. Thus in the end it becomes the prey of big fish sharks and whales. </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp; &nbsp;Here a big question arises that if species like whales will not exist in the sea how marine vegetation will grow? </span></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">On the other hand, the sea becomes a safe place to dump polluted waste.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Where many chemical oil factories pollute the sea by drilling.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Many cables make marine life unsafe.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Countries like China are preparing for a major project by constructing roads at sea.</span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"text-align:right\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">PUBLISHED BY &#39;KAPPALI&#39;</span></span></span></p>\r\n', '1626018925.jpg', '2021-07-11 21:25:26', 'fishless-ocean', 0);
